package com.projects.data.dto;/** * Created by Adeola.Ojo */public class BankProcessor {    private String description;    private int speed;    private int bankid;    private int id;    private boolean isStp;    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public int getSpeed() {        return speed;    }    public void setSpeed(int speed) {        this.speed = speed;    }    public int getBankid() {        return bankid;    }    public void setBankid(int bankid) {        this.bankid = bankid;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public boolean isStp() {        return isStp;    }    public void setStp(boolean stp) {        isStp = stp;    }}